/**
 * 路由组件
 * components 有许多指向是一样的，是页面中存在共用部分
 */
import ChatContainer from '../pages/chat'
import Setting from '../pages/setting'

export const Routers = [
    {
        path: '/',
        components: ChatContainer
    },
    {
        path: '/mail-list',
        components: ChatContainer
    },
    {
        path: '/setting',
        components: Setting
    },
    {
        path: '/set-message',
        components: Setting
    },
    {
        path: '/set-page',
        components: Setting
    },
    {
        path: '/set-login',
        components: Setting
    },
    {
        path: '/set-about',
        components: Setting
    }
]
